import React from 'react';
import Foto from '../../resources/images/foto.jpg';

const Nosotros = () => {
    return (
        <div className="bck_blackest">
            <div className="nosotros_texto encabezado">
                Nosotros
            </div>

            <div className="perfil">
            <img src={Foto} alt="Logo" height="400px"/>
            </div>
        </div>
    );
};

export default Nosotros;
